column13:
A method (82) for reconfiguring a system (10) to store and retrieve data in a data server, the method comprising: 
monitoring (84) current performance data for the system, the current performance data comprising data regarding one or more of storage performance and retrieval performance; 
monitoring (86) current workload data for the system, the current workload data comprising data regarding one or more of storage demand and retrieval demand; 
forming (88) a feature vector for a machine-learning model, the feature vector comprising the current performance data, the current workload data, and data related to a target performance of the system; 
providing (90) the feature vector to the machine-learning model; 
obtaining (92) from the machine-learning model an output of one or more actions to take to adjust a current state of the system based upon the target performance of the system; and 
implementing (94) the one or more actions to adjust the current state of the system.

